import React from "react";
import { Link } from "react-router-dom";
import styles from './phoneRepair.module.css';

const model = {
    apple: ['iPhone 5','iPhone 4', 'iPhone 6', 'iPhone 7', 'iPhone 8', 'iPhone x', 'iPhone 11', 'iPhone 12', 'iPhone 6'
                , 'iPhone 13'],
    samsung: ['j5', 'a5', 'j6', 'a6', 'a9', 'a10', 's9', 's10'],

    htc: ['model1', 'model2', 'model3', 'model4', 'model5']
}


const phoneRepair = (props) => {

    return (
        <Link to = "/iPhone">
            <div className={styles.Main} >
                <img src={props.img} />
                <p>{props.model}</p>
            </div>
        </Link>
    )
}

export default phoneRepair;
